    private void add(int size, int colors, String s) {
        if (size == n && colors == c) {
            byte[] p = new byte[grid.length];
            int k = 0;
            for (int y = 0; y < n; y++) {
                for (int x = 0; x < n; x++) {
                    p[pos(x, y)] = (byte) (s.charAt(k++) - '0');
                }
            }
            patterns.add(p);
        }
    }

    private void init() {
        for (int y = 0; y < n; y++) {
            for (int x = 0; x < n; x++) {
                totPerColor[rawGrid[pos(x, y)]]++;
            }
        }
    }

    private void fillTarget(int dir) {
        if (!patterns.isEmpty()) {
            Arrays.fill(cntPerColor, 0);
            byte[] a = patterns.get(rnd.nextInt(patterns.size()));
            boolean mirror = rnd.nextBoolean();
            for (int y = 0; y < n; y++) {
                for (int x = 0; x < n; x++) {
                    int p = pos(x, y);
                    int q = pos(mirror ? n - 1 - x : x, y);
                    cntPerColor[target[p] = order[a[q]]]++;
                }
            }
            NEXT: for (int i = 0; i < 100000; i++) {
                boolean done = true;
                for (int j = 0; j < c; j++) {
                    if (totPerColor[j] != cntPerColor[j]) {
                        done = false;
                        break;
                    }
                }
                if (done) return;
                int p = allPos[rnd.nextInt(allPos.length)];
                byte c1 = target[p];
                if (cntPerColor[c1] > totPerColor[c1]) {
                    byte c2 = (byte) rnd.nextInt(c);
                    if (c1 != c2 && cntPerColor[c2] < totPerColor[c2]) {
                        if (isFastConnected(target, p, c2)) {
                            target[p] = c2;
                            int s = -1;
                            int x = x(p);
                            int y = y(p);
                            if (x > 0 && target[p - 1] == c1) s = p - 1;
                            else if (x < n - 1 && target[p + 1] == c1) s = p + 1;
                            else if (y > 0 && target[p - line] == c1) s = p - line;
                            else if (y < n - 1 && target[p + line] == c1) s = p + line;
                            if (s >= 0) {
                                int tc = totPerColor[c1];
                                totPerColor[c1] = cntPerColor[c1] - 1;
                                boolean ok = isConnected(target, s, c1);
                                totPerColor[c1] = tc;
                                if (ok) {
                                    cntPerColor[c2]++;
                                    cntPerColor[c1]--;
                                    continue NEXT;
                                }
                            }
                            target[p] = c1;
                        }
                    }
                }
            }
        }
        int x = 0;
        int y = 0;
        int dx = 1;
        int dy = 0;
        if (dir == 1) {
            x = n - 1;
            dx = 0;
            dy = 1;
        }
        Arrays.fill(target, (byte) -1);
        for (byte i : order) {
            int cnt = totPerColor[i];
            for (int j = 0; j < cnt; j++) {
                target[pos(x, y)] = i;
                int nx = x + dx;
                int ny = y + dy;
                if (nx < 0 || nx == n || ny < 0 || ny == n || target[pos(nx, ny)] >= 0) {
                    int aux = dy;
                    dy = dx;
                    dx = -aux;
                }
                x += dx;
                y += dy;
            }
        }
    }

    private String solve() {
        int numTurns = 1;
        if (n <= 5) numTurns = 8;
        else if (n <= 10) numTurns = 6;
        else if (n <= 15) numTurns = 4;
        else if (n <= 20) numTurns = 2;
        String ret = "0";
        for (int turn = 0; turn < numTurns; turn++) {
            for (int y = 0; y < n; y++) {
                for (int x = 0; x < n; x++) {
                    int p = pos(x, y);
                    int x1 = (turn & 4) == 0 ? x : n - 1 - x;
                    int y1 = (turn & 1) == 0 ? y : n - 1 - y;
                    if ((turn & 2) != 0) {
                        int aux = x1;
                        x1 = y1;
                        y1 = aux;
                    }
                    int q = pos(x1, y1);
                    initialGrid[p] = rawGrid[q];
                }
            }
            long now = System.currentTimeMillis();
            long duration = (endTime - now) / (numTurns - turn);
            if (duration < 0) break;
            timeout1 = now + (long) (duration * 0.05);
            timeout2 = now + (long) (duration * 0.95);
            timeout3 = now + duration;
            String s = solve(turn);
            if (s != null) ret = s;
        }
        return ret;
    }

    private String solve(int turn) {
        for (int y = 0; y < n; y++) {
            int x0 = 0;
            int x1 = n;
            boolean down = true;
            int cnt = 0;
            while (x0 < x1) {
                int x = down ? x0 : x1;
                int p = pos(cnt++, y);
                bestPts[p] = pts[p] = pos(x, y);
                down = !down;
                if (down) x0++;
                else x1--;
            }
        }
        int minMoves = moves.length - 1;
        int dir = 1;
        boolean ok = false;
        while (!ok || System.currentTimeMillis() < timeout1) {
            dir = 1 - dir;
            Arrays.sort(order);
            while (!ok || System.currentTimeMillis() < timeout1) {
                System.arraycopy(initialGrid, 0, grid, 0, grid.length);
                fillTarget(dir);
                int numMoves = moveToTarget(minMoves - 1, 0);
                if (numMoves < minMoves) {
                    minMoves = numMoves;
                    System.arraycopy(moves, 0, bestMoves, 0, minMoves);
                    System.arraycopy(target, 0, bestTarget, 0, bestTarget.length);
                    ok = true;
                }
                if (!nextPermutation(order)) break;
            }
            if (patterns.isEmpty() && dir == 1) break;
        }
        int currNumPremoves = 0;
        int bestNumPremoves = 0;
        System.arraycopy(bestTarget, 0, target, 0, bestTarget.length);
        long start = System.currentTimeMillis();
        double t0 = 4;
        double temp = t0;
        int currMoves = minMoves;
        while (minMoves > 0) {
            if ((rep & 31) == 0) {
                long t = System.currentTimeMillis();
                if (t >= timeout2) break;
                temp = t0 * (timeout2 - t) / (timeout2 - start);
            }
            rep++;
            System.arraycopy(initialGrid, 0, grid, 0, grid.length);
            int type = rep % 3;
            if (type == 0) {
                int x0 = rnd.nextInt(n - 1);
                int x1 = rnd.nextInt(n - 1);
                if (x1 >= x0) x1++;
                if (x0 > x1) {
                    int aux = x0;
                    x0 = x1;
                    x1 = aux;
                }
                int y = rnd.nextInt(n);
                int mode = rnd.nextInt(3);
                if (mode == 0) {
                    while (x0 < x1) {
                        int aux = pts[pos(x0, y)];
                        pts[pos(x0++, y)] = pts[pos(x1, y)];
                        pts[pos(x1--, y)] = aux;
                    }
                } else if (mode == 1) {
                    int aux = pts[pos(x1, y)];
                    for (int i = x1; i > x0; i--) {
                        pts[pos(i, y)] = pts[pos(i - 1, y)];
                    }
                    pts[pos(x0, y)] = aux;
                } else {
                    int aux = pts[pos(x0, y)];
                    for (int i = x0; i < x1; i++) {
                        pts[pos(i, y)] = pts[pos(i + 1, y)];
                    }
                    pts[pos(x1, y)] = aux;
                }
            } else if (type == 1) {
                modifyTarget();
            } else {
                int op = currNumPremoves == 0 ? 0 : currNumPremoves == premoves.length ? rnd.nextInt(1, 3) : rnd.nextInt(3);
                if (op == 0) {
                    premoves[currNumPremoves++] = move(pos(rnd.nextInt(n - 1), rnd.nextInt(n - 1)), rnd.nextBoolean() ? 0 : 2);
                } else if (op == 1) {
                    int idx = rnd.nextInt(currNumPremoves);
                    premoves[idx] = premoves[--currNumPremoves];
                } else if (op == 2) {
                    int idx = rnd.nextInt(currNumPremoves);
                    premoves[idx] = move(pos(rnd.nextInt(n - 1), rnd.nextInt(n - 1)), rnd.nextBoolean() ? 0 : 2);
                }
            }
            int cut = currMoves - (int) Math.round(log[rnd.nextInt(log.length)] * temp);
            int numMoves = moveToTarget(cut, currNumPremoves);
            if (numMoves <= cut) {
                if (type == 0) System.arraycopy(pts, 0, bestPts, 0, bestPts.length);
                else if (type == 1) System.arraycopy(target, 0, bestTarget, 0, bestTarget.length);
                else System.arraycopy(premoves, 0, bestPremoves, 0, bestNumPremoves = currNumPremoves);
                currMoves = numMoves;
                if (numMoves < minMoves) {
                    minMoves = numMoves;
                    System.arraycopy(moves, 0, bestMoves, 0, minMoves);
                }
            } else {
                if (type == 0) System.arraycopy(bestPts, 0, pts, 0, bestPts.length);
                else if (type == 1) System.arraycopy(bestTarget, 0, target, 0, bestTarget.length);
                else System.arraycopy(bestPremoves, 0, premoves, 0, currNumPremoves = bestNumPremoves);
            }
        }
        minMoves = clean(minMoves);
        if (minMoves < overallMin) {
            overallMin = minMoves;
            return mountRet(minMoves, turn);
        }
        return null;
    }

    private int clean(int minMoves) {
        boolean[] conn = new boolean[c];
        while (System.currentTimeMillis() < timeout3) {
            boolean imp = false;
            NEXT: for (int i = minMoves - 1; i >= 0 && System.currentTimeMillis() < timeout3; i--) {
                System.arraycopy(initialGrid, 0, grid, 0, grid.length);
                for (int j = 0; j < minMoves; j++) {
                    if (j == i) continue;
                    int m = bestMoves[j];
                    int p0 = pos(m);
                    int d = dir(m);
                    int p1 = p0 + (d == 0 ? 1 : d == 1 ? -1 : d == 2 ? +line : -line);
                    byte aux = grid[p0];
                    grid[p0] = grid[p1];
                    grid[p1] = aux;
                }
                Arrays.fill(conn, false);
                int k = 0;
                IN: for (int y = 0; y < n; y++) {
                    for (int x = 0, p = pos(0, y); x < n; x++, p++) {
                        byte color = grid[p];
                        if (conn[color]) continue;
                        if (!isConnected(grid, p, color)) continue NEXT;
                        if (++k == c) break IN;
                        conn[color] = true;
                    }
                }
                System.arraycopy(bestMoves, i + 1, bestMoves, i, minMoves - i - 1);
                minMoves--;
                imp = true;
            }
            if (!imp) break;
        }
        return minMoves;
    }

    private void modifyTarget() {
        while (true) {
            int p1 = allPos[rnd.nextInt(allPos.length)];
            byte c1 = target[p1];
            int p2 = allPos[rnd.nextInt(allPos.length)];
            byte c2 = target[p2];
            if (c2 == c1) continue;
            target[p1] = c2;
            target[p2] = c1;
            if (!isFastConnected(target, p1, c2) || !isFastConnected(target, p2, c1) || !isConnected(target, p1, c2) || !isConnected(target, p2, c1)) {
                target[p1] = c1;
                target[p2] = c2;
                continue;
            }
            return;
        }
    }

    private int moveToTarget(int cut, int numPreMoves) {
        int numMoves = 0;
        for (int i = 0; i < numPreMoves; i++) {
            int m = moves[numMoves++] = premoves[i];
            int p0 = pos(m);
            int d = dir(m);
            int p1 = d == 0 ? p0 + 1 : p0 + line;
            byte aux = grid[p0];
            grid[p0] = grid[p1];
            grid[p1] = aux;
        }
        for (int y0 : yorder) {
            Arrays.fill(used, false);
            for (int i = 0; i < n; i++) {
                int p = pts[pos(i, y0)];
                byte t = target[p];
                int x0 = x(p);
                if (grid[p] == t) {
                    used[x0] = true;
                    continue;
                }
                int[] cp = sortedCand[p];
                int p0 = -1;
                for (int a : cp) {
                    if (grid[a] == t) {
                        p0 = a;
                        break;
                    }
                }
                int md = p0 == -1 ? n : Math.abs(x(p0) - x0) + y(p0) - y0;
                for (int x = x0; x >= 0; x--) {
                    if (used[x]) break;
                    int d = x0 - x;
                    if (d >= md) break;
                    int q = pos(x, y0);
                    if (grid[q] != t) continue;
                    p0 = q;
                    md = d;
                    break;
                }
                for (int x = x0 + 1; x < n; x++) {
                    if (used[x]) break;
                    int d = x - x0;
                    if (d >= md) break;
                    int q = pos(x, y0);
                    if (grid[q] != t) continue;
                    p0 = q;
                    md = d;
                    break;
                }
                if (p0 == -1) return 1000000;
                used[x0] = true;
                int nx = x(p0);
                int ny = y(p0);
                while (nx != x0 || ny != y0) {
                    int p1 = p0;
                    if (nx < x0) {
                        moves[numMoves++] = move(p0, 0);
                        nx++;
                        p1++;
                    } else if (nx > x0) {
                        moves[numMoves++] = move(p0, 1);
                        nx--;
                        p1--;
                    } else if (ny > y0) {
                        moves[numMoves++] = move(p0, 3);
                        ny--;
                        p1 -= line;
                    } else {
                        moves[numMoves++] = move(p0, 2);
                        ny++;
                        p1 += line;
                    }
                    if (numMoves > cut) return numMoves;
                    byte aux = grid[p0];
                    grid[p0] = grid[p1];
                    grid[p1] = aux;
                    p0 = p1;
                }
            }
        }
        return numMoves;
    }

    private boolean isFastConnected(byte[] a, int pos, byte color) {
        if (totPerColor[color] == 1) return true;
        int x = x(pos);
        if (x > 0 && a[pos - 1] == color) return true;
        if (x < n - 1 && a[pos + 1] == color) return true;
        int y = y(pos);
        if (y > 0 && a[pos - line] == color) return true;
        if (y < n - 1 && a[pos + line] == color) return true;
        return false;
    }

    private boolean isConnected(byte[] a, int pos, byte color) {
        int tc = totPerColor[color];
        if (tc == 1) return true;
        int tot = 1;
        int curr = 0;
        queue[0] = pos;
        Arrays.fill(seen, false);
        seen[pos] = true;
        int np = 0;
        while (curr < tot) {
            pos = queue[curr++];
            int x = x(pos);
            if (x > 0 && a[np = pos - 1] == color && !seen[np]) seen[queue[tot++] = np] = true;
            if (x < n - 1 && a[np = pos + 1] == color && !seen[np]) seen[queue[tot++] = np] = true;
            int y = y(pos);
            if (y > 0 && a[np = pos - line] == color && !seen[np]) seen[queue[tot++] = np] = true;
            if (y < n - 1 && a[np = pos + line] == color && !seen[np]) seen[queue[tot++] = np] = true;
        }
        return tot == tc;
    }

    private String mountRet(int numMoves, int turn) {
        StringBuilder sb = new StringBuilder();
        sb.append(numMoves).append(System.lineSeparator());
        for (int i = 0; i < numMoves; i++) {
            int m = bestMoves[i];
            int x0 = x(m);
            int y0 = y(m);
            int d = dir(m);
            int x1 = d == 0 ? x0 + 1 : d == 1 ? x0 - 1 : x0;
            int y1 = d == 2 ? y0 + 1 : d == 3 ? y0 - 1 : y0;
            if ((turn & 4) != 0) {
                x0 = n - 1 - x0;
                x1 = n - 1 - x1;
            }
            if ((turn & 1) != 0) {
                y0 = n - 1 - y0;
                y1 = n - 1 - y1;
            }
            if ((turn & 2) != 0) {
                int aux = x0;
                x0 = y0;
                y0 = aux;
                aux = x1;
                x1 = y1;
                y1 = aux;
            }
            sb.append(y0).append(' ').append(x0).append(' ').append(y1).append(' ').append(x1).append(System.lineSeparator());
        }
        return sb.toString();
    }

    private int dir(int p) {
        return p >>> 10;
    }

    private int move(int p, int dir) {
        return p | (dir << 10);
    }

    private int pos(int x, int y) {
        return x | (y << shift);
    }

    private int pos(int m) {
        return m & 1023;
    }

    private int x(int p) {
        return p & mask;
    }

    private int y(int p) {
        return (p >>> shift) & mask;
    }

    private static boolean nextPermutation(byte[] a) {
        int i = a.length;
        while (--i > 0 && (a[i - 1] >= a[i])) {
        }
        if (i == 0) return false;
        int j = a.length + 1;
        while (--j > 0 && (a[j - 1] <= a[i - 1])) {
        }
        byte x = a[j - 1];
        a[j - 1] = a[i - 1];
        a[i - 1] = x;
        j = a.length - 1;
        while (i < j) {
            x = a[j];
            a[j] = a[i];
            a[i++] = x;
            j--;
        }
        return true;
    }

